import React, {Component} from 'react'


class ArticleList extends Component {



    constructor(props){
        super(props)
        this.state = {
            list: this.props.list
        }
      }


      render() {
          return (
              <div>
                  <ul>
                    {this.state.list.map(el => (
                        <li>
                        {el.title}
                        </li>
                    ))}
                  </ul>
              </div>
          )
      }

}

export default ArticleList

